import React from 'react';
import { Outlet,Link } from 'react-router-dom';
import Written from './Written';
import { useState } from 'react';
import ShowResult from './ShowResult';
export default function Home() {
  const [showResultContent, setShowResultContent] = useState(false);

  const handleClick01 = () => {
    setShowResultContent(true);
  };
  return (
    <>
      <nav className="navbar navbar-light bg-info">
        <h2 className="navbar-brand mb-0 h1">MALLA REDDY COLLEGE OF ENGINEERING & TECHNOLOGY</h2>
        <nav className="navbar navbar-light bg-info">
          <h4>Welcome Admin</h4>
        </nav>
      </nav>
      <nav className="navbar navbar-light bg-warning">
        <marquee>
          <h3 className="navbar-brand mb-0 h1">Highest Package AC.Yr 2024:</h3>
        </marquee>
      </nav><br></br><br></br>
      <div className="main-content text-center">
        <div className="button-container text-center">
          <button onClick={handleClick01} className="btn btn-primary">Written Test Results</button>
          {showResultContent && <ShowResult />}<br></br><br></br> 
          <button className="btn btn-success">Companies Active</button><br></br><br></br>
          <button className="btn btn-info">Schedule</button>
         
        </div>
      </div>
    </>
  );
}
